import React from 'react'
import Tech from '../../Tech/Tech'
import Latest from '../Latest/Latest';
import Article from '../LatestArticle.jsx/Aarticle';
import Latestheading from '../Latestheading/Latestheading';
import LatestStories from '../LatestStories/LatestStories';
import maintech from './maintech.css';
function MainTech() {
    return (
        <div className='adjust-all'>
            <Latestheading data={{ name1: "Technology" }} />
            <div className='main-tech'>
                <Tech heading={"Atom and Charge"} img={"/Image/planetary-ring-ringed-planet-planet-stars-wallpaper-preview.jpg"}/>
                <Tech heading={"Universe"} img={"/Image/Portrait_of_Sir_Isaac_Newton,_1689.jpg"}/>
                <Tech heading={"Magnitic field"} img={"/Image/Magnetic-Field.jpg"}/>
                <Tech heading={"Rocket"} img={"Image/Screenshot 2020-08-10 at 4.31.07 PM.png"}/>
                <Tech heading={"Gravity"} img={"/Image/Magnetic-Field.jpg"}/>
                <Tech heading={"Newton"} img={"/Image/planetary-ring-ringed-planet-planet-stars-wallpaper-preview.jpg"}/>
                <Latest heading={"Coding"} img={"/Image/Magnetic-Field.jpg"}/>
            </div>
        </div>
    )
}

export default MainTech
